class Solution {
    fun minimumCost(source: String, target: String, original: Array<String>, changed: Array<String>, cost: IntArray): Long {
        val dp = Array(source.length + 1) { LongArray(target.length + 1) { Long.MAX_VALUE } }
        dp[0][0] = 0L
        for (i in source.indices) {
            for (j in target.indices) {
                if (dp[i][j] == Long.MAX_VALUE) continue
                var k = i
                var l = j
                while (k < source.length && l < target.length && source[k] == target[l]) {
                    k++
                    l++
                    dp[k][l] = minOf(dp[k][l], dp[i][j])
                }
                for (x in original.indices) {
                    if (i + original[x].length <= source.length && source.substring(i, i + original[x].length) == original[x]) {
                        for (y in changed.indices) {
                            if (original[x] == original[y] && changed[x] == changed[y] && j + changed[y].length <= target.length && target.substring(j, j + changed[y].length) == changed[y]) {
                                dp[i + original[x].length][j + changed[y].length] = minOf(dp[i + original[x].length][j + changed[y].length], dp[i][j] + cost[y])
                            }
                        }
                    }
                }
            }
        }
        return if (dp[source.length][target.length] == Long.MAX_VALUE) -1 else dp[source.length][target.length]
    }
}
